    true,nt"url": null,nt"notes": "The GEOECOLOGY Data Base is a compilation
    of environmental data for research and development needs that includes information
    for the period 1964 to 1979. The GEOECOLOGY Data Base contains selected data on
    terrain and soils, water resources, forestry, vegetation, agriculture, land use,
    wildlife, air quality, climate, natural areas, and endangered species. Data on selected
    human population characteristics are also included to complement the environmental
